أول نقطة هي ان 
الشركه المنتجه لهالمنتج شركه امريكية اسمها Forever عمرها 40 سنة تقريباً ركزت جداً على جودة منتجاتها و بدت الناس بأمريكا تحب منتجاتها و انتشرت بشكل كبير و امدت لكل العالم و هي حالياً تصنف من أقوى شركات انتاج خلاصه الصبار حيث تنتج 80 مليون جالون سنوياً 
ثاني نقطه و ندخل فيها على المنتج نفسه الي كسب سمعه كبيره بالخليج و هو C9 - البرنامج كان فعّال لكل احد جرّبه. - البرنامج طبيعي و هاي أقوى نقطه تميزه عن باقي المنتجات، يعني الي يستهلك البرنامج ياخذه و هو مطمن انه ما بيكون في أعراض جانبية لا عالمدى القريب ولا عالمدى البعيد. - طريقة عمل البرنامج تعتمد على طريقة علمية و الي هي الـ Detox وهي الي تخلي الجسم يخسر وزنه بطريقة صحية و سليمة للجسم و صعب انه يستعيد الوزن هالوزن إلا اذا ( خربها في عزايم الربع ) 😁
- محد اشتكى! 
عمر الشركة في مثل ما قلنا 40 سنة تقريباً 
